Rebus - Black and Blue  (2000)


The first of the REBUS programs introduces the Scottish Detective Inspector John Rebus as he untangles the various strands of the interwoven web of criminal intrigues from Leith, Edinburgh to Aberdeen and Glasgow and points between. A serial killer of young women of the past, known as 'The Preacher' appears to have a copycat murderer dubbed 'The Disciple', who is repeating the modus operandi. But is it 'The Preacher' who has returned to continue his work of death? Or it is truly another serial killer at work? Intermingled with the workings of the CID Edinburgh to ... 



